import React from "react";


function FormationBar({ setFormationPage }) {

    return (
        <div id="formation-bar-container">
            <button onClick={e => setFormationPage("myformations")}>My Formations</button>
            <button onClick={e => setFormationPage("newformation")}>Build New Formation</button>
            <input type="text" placeholder="search..." />
            <select>
                <option value="formation">Formation</option>
                <option value="user">User</option>
            </select>
        </div>
    );
};

export default FormationBar;
